import React from "react";

function Login () {
    return (
        <div className="regWindow">
            <div className="window">
                <div>
                    <div className="centerlog">
                        <h2>Авторизация</h2>
                    </div>
                    <div className="pad">
                        <input type="text" className="form-control" placeholder="Логин"></input>
                        <input type="text" className="form-control" placeholder="Пароль"></input>
                    </div>
                    <button type="button" className="btn btn-outline-warning pad">Войти</button>
                </div>
            </div>
        </div>
    )
}
export default Login;
